/** needs square */
import React, { useState } from 'react';

export default function Square(props) {
    let squareType = "square";

    if (props.color == 'white'){
        squareType += ' ' + 'white';
    }

    if (props.letter){
        return (<div className={squareType}>{props.letter}</div>);
    }

    return(
        <div className={squareType}>square</div>);
}
